INSERT INTO `Manpage` (`id`, `author_id`, `parent_id`, `subject`, `content`, `createdDateTime`, `updatedDateTime`) VALUES
  (1, NULL, NULL, 'main help menu', '<p>Welcome to the NeoCortex Online Help System</p><p>Please keep in mind that you can use the official <a target="_blank" href="https://wiki.h4x0r4g3.com">WIKI</a> to get information about many topics. For new players there is also the &quot;newbie chat channel&quot;, which you can use by typing &quot;new [yourmessage]&quot;.</p><ul><li><a id="2" href="#2">Newbie tutorial</a></li><li>FAQ</li></ul>', '2017-07-07 00:00:00', '2017-07-08 16:04:00'),
  (2, NULL, NULL, 'newbie tutorial', '<p>Important commands:</p><ul><li>&quot;commands&quot; (shows a list of all available commands)</li></ul><p>&nbsp;</p>', '2017-07-08 13:31:49', '2017-07-15 14:09:30'),
  (3, NULL, NULL, 'FAQ', '<p>TODO FAQ</p>', '2017-07-08 13:35:55', '2017-07-08 13:51:43'),
  (4, NULL, NULL, 'neocortex', '<p>The NeoCortex Network, an elite underground organization that supplies the cutting-edge NeoCortex&nbsp;OS, a cloud&nbsp;OS&nbsp;that guarantees perfect anonymity for all users of the Network.</p>', '2017-07-15 13:59:27', '2017-07-15 14:00:20'),
  (5, NULL, NULL, 'addconnection', '<p>syntax: addconnection &lt;target_node_id&gt;</p><p>cost: 10c</p><p>Creates a new connection to the given target node.</p>', '2017-07-15 14:09:57', '2017-07-15 14:11:52'),
  (6, NULL, NULL, 'addnode', '<p>No arguments.</p><p>Cost: 50c</p><p>Creates a new node from the node that you are currently in.</p>', '2017-07-15 14:12:04', '2017-07-15 14:12:43'),
  (7, NULL, NULL, 'nodes', '<p>Cyberspace systems are made up of many nodes. Each node represents a section or area of the system. Nodes can have many types for different purposes. Nodes are linked to each other via &quot;connections&quot;. To move from node to node, you can use the command cd and either give the connection number of its name.</p>', '2017-07-15 14:13:03', '2017-07-15 14:15:37'),
  (8, NULL, NULL, 'connections', '<p>Connections link the different nodes of the system together. Think of them as doorways or gates, some of which can be locked. You can use a connection with the &quot;cd&quot; command, but you might need to get past the connections security measures first.</p>', '2017-07-15 14:16:17', '2017-07-15 14:17:33'),
  (9, NULL, NULL, 'ls', '<p>The &quot;ls&quot; command shows all important information about the node that you are currently in.</p>', '2017-07-15 14:18:45', '2017-07-15 14:19:12'),
  (10, NULL, NULL, 'attack', '<p>syntax: attack &lt;entity-number or name&gt;</p><p>The &quot;attack&quot; command is used to attack the given&nbsp;entity. The entity can be specified by its name or its number in the &quot;ls&quot; command output.</p>', '2017-07-15 14:19:30', '2017-07-15 14:20:17'),
  (11, NULL, NULL, 'cd', '<p>syntax: cd &lt;connection-number or -name&gt;</p><p>Uses the given connection to reach the target node. The connection can be given by its number in the &quot;ls&quot; command output or by its name.</p>', '2017-07-15 14:20:34', '2017-07-15 14:21:36'),
  (12, NULL, NULL, 'changepassword', '<p>syntax: cd &lt;connection-number or -name&gt;</p><p>Uses the given connection to reach the target node. The connection can be given by its number in the &quot;ls&quot; command output or by its name.</p>', '2017-07-15 14:22:11', '2017-07-15 14:22:42'),
  (13, NULL, NULL, 'clear', '<p>Used to clear the current screen output.</p>', '2017-07-15 14:23:07', '2017-07-15 14:23:20'),
  (14, NULL, NULL, 'code', '<p>No arguments. Used in a coding node to enter the coding-mode, in which you can work on your file parts and programs.</p>', '2017-07-15 14:23:28', '2017-07-15 14:24:42'),
  (15, NULL, NULL, 'coding-mode', '<p><strong>Once you have entered coding mode, you can use the following commands:</strong></p><ul><li>q</li><li>mode </li><li>type </li><li>level </li><li>options</li><li>code</li><li>jobs</li><li>res</li></ul><p><strong>q:</strong><br />quits coding mode</p><p><strong>mode:</strong><br />takes &quot;part&quot; or &quot;program&quot; as an argument to switch to that coding type respectively</p><p><strong>type:</strong><br />takes the file-part or file-type as an argument to specify the type - no argument to see a list of possible options</p><p><strong>level:</strong><br />takes the target level of the program or part as an argument - must be between 1 and 100</p><p><strong>options:</strong><br />shows the currently set options and required resources and skills for the current settings</p><p><strong>code:</strong><br />starts the coding attempt</p><p><strong>jobs:</strong><br />shows the currently queued coding jobs</p><p><strong>res:</strong><br />shows your current file-part resources</p>', '2017-07-15 14:24:58', '2017-07-15 14:33:40'),
  (16, NULL, NULL, 'commands', '<p>Shows a list of all available commands.</p>', '2017-07-15 14:34:39', '2017-07-15 14:34:53'),
  (17, NULL, NULL, 'connect', '<p><strong>syntax: connect &lt;system-addy&gt; &lt;node-id&gt;</strong></p><p>Used in io-nodes to connect to the given system and node-id. You must know the addy and node-id to use this command. Use this command without arguments to see a list of all public io-nodes that you could connect to.</p>', '2017-07-15 14:35:11', '2017-07-15 14:36:28');
